issue.body:
Part of a continued effort to maintain minimal 3rd party dependencies.


@WilliamKarolDiCioccio verify that the difference between `delete` and `backspace` is intended, otherwise combine into:
```dart
case LogicalKeyboardKey.backspace || LogicalKeyboardKey.delete:
  for (final nodeId in widget.controller.selectedNodeIds) {
    widget.controller.removeNode(
      nodeId,
      isHandled: nodeId != widget.controller.selectedNodeIds.last,
    );
  }
  widget.controller.clearSelection();
```
